        class TextFieldParser : StreamReader
        {
            private int lineNumber = 0;
                

            int _textFieldType = 0;
            public int TextFieldType
            {
                get
                {
                    return _textFieldType;
                }
                set
                {
                    if ( value.GetType() == typeof(DSP_Speed_and_Consumption_Tweaks_Plugin.FieldType) )
                        _textFieldType = value;
                }
            }

            bool hasFieldsEnclosedInQuotes = false;

            public bool HasFieldsEnclosedInQuotes
            {
                get
                {
                    return hasFieldsEnclosedInQuotes;
                }
                set
                {
                    if (value.GetType() == typeof(bool))
                        hasFieldsEnclosedInQuotes = value;
                }
            }


            HashSet<char> _delimiters = null;

            public char[] SetDelimiters(char[] delimiters)
            {
                if (_delimiters != null) _delimiters =null;
                _delimiters = new HashSet<char>(delimiters);
                return _delimiters.ToArray<char>();
            }

            public char[] SetDelimiters(string delimiters)
            {
                return SetDelimiters( delimiters.ToArray<char>() );
            }

            public TextFieldParser(string path) : base(path)
            {


            }

            internal string[] ReadFields()
            {
                //LogError("ReadFields called");
                if (lineNumber == 0) ReadLine();
                lineNumber++;

                string line = ReadLine();
                if ( ! EndOfStream)
                {
                    //LogError();
                    List<StringBuilder> fields = new List<StringBuilder>();
                    //LogError();
                    StringBuilder field = new StringBuilder();

                    //LogError(); 
                    
                    

                    //LogError();
                    bool inQuotes = false;
                    //LogError();
                    char lastChar = ' ';
                    //LogError($"this is the length of the line {line.Length} and it's contents  : {line}");
                    for (int i = 0; i < line.Length; i++)
                    {
                        //LogError($"This is the current position in the file {base.BaseStream.Position}");
                        //LogError($"This is the index of the line {i} and it's contents  : {line[i]}");
                        if (hasFieldsEnclosedInQuotes && line[i] == '"' && (lastChar != '\\'))
                        {
                            //LogError($"inQuotes = !{inQuotes}");
                            inQuotes = !inQuotes;
                            //LogError($"inQuotes = {inQuotes}");
                            continue;
                        }
                        //LogError($"We are in the field value");
                        //LogError($"fields.Count = {fields.Count}");
                        //LogError($"inQuotes = {inQuotes}");
                        //LogError($"_delimiters.Contains(line[i]) = {_delimiters.Contains(line[i])}");
                        if (
                            !inQuotes 
                            && _delimiters.Contains(line[i])
                           )
                        {
                            //LogError($"feild = {field.ToString()}");
                            fields.Add(field);
                            //LogError();
                            field = new StringBuilder();
                            //LogError();
                            continue;
                        }
                        //LogError();
                        field.Append(line[i]);
                        //LogError();
                        lastChar = line[i];
                    }
                    fields.Add(field);
                    //LogError();
                    return fields.Select(stringBuilder => stringBuilder.ToString()).ToArray();
                }
                //LogError();
                return new List<string>().ToArray();
            }
        }
